[{"location":"","page":"Home","title":"Home","text":"CurrentModule = Catch22","category":"page"},{"location":"#Catch22.jl","page":"Home","title":"Catch22.jl","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for Catch22.jl. For detailed information about the catch22 feature set, see the catch22 wiki and the original publication, Lubba et al. (2019)","category":"page"},{"location":"","page":"Home","title":"Home","text":"Modules = [Catch22]","category":"page"},{"location":"","page":"Home","title":"Home","text":"Modules = [Catch22]","category":"page"},{"location":"#Catch22.c22","page":"Home","title":"Catch22.c22","text":"c22\n\nThe Catch22 feature set with shortened names; see catch22.\n\n\n\n\n\n","category":"constant"},{"location":"#Catch22.c24","page":"Home","title":"Catch22.c24","text":"c24\n\nThe Catch24 feature set with shortened names; see catch24.\n\n\n\n\n\n","category":"constant"},{"location":"#Catch22.catch22","page":"Home","title":"Catch22.catch22","text":"catch22(𝐱::Vector)\ncatch22(X::Array)\ncatch22[featurename::Symbol](X::Array)\n\nEvaluate all features for a time series vector 𝐱 or the columns of an array X. catch22 is a FeatureSet, which means it can be indexed by feature names (as symbols) to return a subset of the available features. getnames(catch22), getkeywords(catch22) and getdescriptions(catch22) will also return feature names, keywords and descriptions respectively. Features are returned in a FeatureArray, in which array rows are annotated by feature names. A FeatureArray can be converted to a regular array with Array(F).\n\nExamples\n\n𝐱 = Catch22.testdata[:test]\n𝐟 = catch22(𝐱)\n\nX = randn(100, 10)\nF = catch22(X)\nF = catch22[:DN_HistogramMode_5](X)\n\n\n\n\n\n","category":"constant"},{"location":"#Catch22.catch22_raw","page":"Home","title":"Catch22.catch22_raw","text":"The set of Catch22 features without a preliminary z-score\n\n\n\n\n\n","category":"constant"},{"location":"#Catch22.catch24","page":"Home","title":"Catch22.catch24","text":"catch24 isa FeatureSet\n\nA feature set containing the mean (DN_Mean) and standard deviation (DN_Spread_Std) in addition to all catch22 features. See catch22.\n\n\n\n\n\n","category":"constant"},{"location":"#Catch22.featuredescriptions","page":"Home","title":"Catch22.featuredescriptions","text":"Catch22.featuredescriptions\n\nA vector listing short descriptions of each feature, as strings.\n\n\n\n\n\n","category":"constant"},{"location":"#Catch22.featurekeywords","page":"Home","title":"Catch22.featurekeywords","text":"Catch22.featurekeywords\n\nA vector listing keywords of features as vectors of strings.\n\n\n\n\n\n","category":"constant"},{"location":"#Catch22.DN_HistogramMode_5","page":"Home","title":"Catch22.DN_HistogramMode_5","text":"DN_HistogramMode_5(x::AbstractVector{Union{Float64, Int}}) # For example\n\nAn alternative to catch22(:DN_HistogramMode_5](x). All features, such as DN_HistogramMode_5, are exported as Features and can be evaluated by calling their names.\n\nExamples\n\n𝐱 = Catch22.testdata[:test]\nf = DN_HistogramMode_5(𝐱)\n\n\n\n\n\n","category":"function"},{"location":"#Catch22._catch22-Tuple{AbstractVector{T} where T, Symbol}","page":"Home","title":"Catch22._catch22","text":"_catch22(𝐱::AbstractArray{Float64}, fName::Symbol)\n_catch22(fName::Symbol, 𝐱::AbstractArray{Float64})\n\nEvaluate the feature fName on the single time series 𝐱. See Catch22.featuredescriptions for a summary of the 22 available time series features. Time series with NaN or Inf values will produce NaN feature values.\n\nExamples\n\n𝐱 = Catch22.testdata[:test]\nCatch22._catch22(𝐱, :DN_HistogramMode_5)\n\n\n\n\n\n","category":"method"}]
